    <div class=\"disabled item\">{{- block('previous_page_message') -}}</div>
{%- endblock previous_page_link_disabled -%}

{%- block next_page_link -%}
    <a class=\"item\" href=\"{{- path -}}\" rel=\"next\">{{- block('next_page_message') -}}</a>
{%- endblock next_page_link -%}

{%- block next_page_link_disabled -%}
    <div class=\"disabled item\">{{- block('next_page_message') -}}</div>
{%- endblock next_page_link_disabled -%}

